import React from 'react'
import { BrowserRouter as Router,Routes,Route } from "react-router-dom";
import App from './App';
import Login from './Login';

function Nav() {
  return (
    <div>
      <Router>
        <Routes>
            <Route path='/' element={<App/>}></Route>
            <Route path='/login' element={<Login/>}></Route>
        </Routes>
      </Router>
    </div>
  )
}

export default Nav;
